import React, { useState } from 'react';
import { MenuItem as MenuItemType, MenuItemInitial } from '../types';
import {
  Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper,
  Button, Dialog, DialogActions, DialogContent, DialogTitle, IconButton
} from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';
import MenuItemForm from './MenuItemForm';

interface MenuItemListProps {
  items: MenuItemType[];
  addItem: (item: MenuItemInitial) => void;
  updateItem: (id: string, item: MenuItemInitial) => void;
  deleteItem: (id: string) => void;
}

const MenuItemList: React.FC<MenuItemListProps> = ({ items, addItem, updateItem, deleteItem }) => {
  const [open, setOpen] = useState(false);
  const [confirmOpen, setConfirmOpen] = useState(false);
  const [deleteId, setDeleteId] = useState<string | null>(null);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const handleConfirmOpen = (id: string) => {
    setDeleteId(id);
    setConfirmOpen(true);
  };

  const handleConfirmClose = () => {
    setConfirmOpen(false);
    setDeleteId(null);
  };

  const handleDelete = () => {
    if (deleteId) {
      deleteItem(deleteId);
      handleConfirmClose();
    }
  };

  return (
    <div>
      <Button variant="contained" color="primary" className="add-menu-btn" startIcon={<AddIcon />} onClick={handleClickOpen}>
        Add Menu
      </Button>
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Add Menu Item</DialogTitle>
        <DialogContent>
          <MenuItemForm addItem={addItem} onClose={handleClose} />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="primary">
            Cancel
          </Button>
        </DialogActions>
      </Dialog>
      <Dialog open={confirmOpen} onClose={handleConfirmClose}>
        <DialogTitle>Confirm Delete</DialogTitle>
        <DialogContent>
          Are you sure you want to delete this item?
        </DialogContent>
        <DialogActions>
          <Button onClick={handleConfirmClose} color="primary">
            Cancel
          </Button>
          <Button onClick={handleDelete} color="secondary">
            Delete
          </Button>
        </DialogActions>
      </Dialog>
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow className="table-header">
              <TableCell className="table-header">Category</TableCell>
              <TableCell className="table-header">Name</TableCell>
              <TableCell className="table-header">Options</TableCell>
              <TableCell className="table-header">Price</TableCell>
              <TableCell className="table-header">Cost</TableCell>
              <TableCell className="table-header">Stock</TableCell>
              <TableCell className="table-header">Actions</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {items.map((item, index) => (
              <TableRow key={item.id} className={index % 2 === 0 ? 'table-row' : ''}>
                <TableCell>{item.category}</TableCell>
                <TableCell>{item.name}</TableCell>
                <TableCell>{item.options}</TableCell>
                <TableCell>{item.price}</TableCell>
                <TableCell>{item.cost}</TableCell>
                <TableCell>{item.stock}</TableCell>
                <TableCell>
                  <IconButton color="primary" onClick={() => updateItem(item.id, item)}>
                    <EditIcon />
                  </IconButton>
                  <IconButton color="secondary" onClick={() => handleConfirmOpen(item.id)}>
                    <DeleteIcon />
                  </IconButton>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
};

export default MenuItemList;
